INSERT INTO `crawl_zone` VALUES (2,'21','연동 신시가지','[할인]','광주약국 뒤편 유료 양심 주차장','제주도 제주시 연동 1458','0','00:00~23:59','왕복','1',NULL,'1','33.481152','126.490219','연동 대림1차 APT 입구 → 북측 파리바게트 방면 50m 이동 → 횡단보도를 건너 광주약국 좌측에 끼고 뒷편으로 이동 →  GS 편의점 건너편 유료 양심 주차장에 쏘카존이 있습니다.','http://dmaps.kr/qnhv','http://blog.socar.kr/6955','',''),(3,'105','제주공항','[BMW]','제주 쏘카 스테이션','제주도 제주시 도두2동 159-3','1','00:00~23:59','왕복','1',NULL,'192','33.494148','126.491417','공항 1층 5번 게이트를 나와 횡단보도 이용 → 렌터카하우스 방향으로 이동 → 4구역 13번에서 쏘카 셔틀 차량(카운티 또는 스타렉스)을 타고 이동 → 신광사거리 쏘카 스테이션 도착.\r\n<br>\r\n셔틀버스 운행: 08:00~20:00 (15분간격)\r\n<br>\r\n쏘카존 막차 출발시간 19:45\r\n<br>\r\n제주공항 막차 출발시간 20:00\r\n<br>\r\n(매시 정각, 15분, 30분, 45분 출발)','http://dmaps.kr/684kt','http://blog.socar.kr/6954','<br>※ 이용 전 안내 <br> ● 예약상황에 따라 차량번호가 변경 될 수 있으니, 사용 직전 예약 된 차량번호를 최종 확인해주세요.','● 편도 이용 고객 안내\r\n※ 쏘카 스테이션에 주차해주세요.\r\n※ 차량 사용 완료시 \"바로반납\" 버튼을 눌러주세요.'),(4,'110','제주 시외버스터미널','','터미널 유료주차장','제주도 제주시 오라1동 2441-3','0','00:00~23:59','왕복','1',NULL,'2','33.499702','126.514511','제주 시외버스터미널 → GS25 제주터미널점 방면 48m 이동 → 왼쪽 주차장 입구로 진입 → 터미널 유료주차장 도착','http://dmaps.kr/n3ab','http://blog.socar.kr/6953','',''),(5,'114','제주시청 앞','','블랙야크 뒷편 천일주차장','제주도 제주시 이도2동 1773-10','0','00:00~23:59','왕복','1',NULL,'7','33.500179','126.528336','CGV → 광양사거리 방면 70m 이동 → 블랙야크 골목 우회전 후 20m 이동 → 천일주차장 도착','http://dmaps.kr/e23a','http://blog.socar.kr/6952','',''),(6,'130','노형동 정존마을회관','[할인]','정존마을 회관 앞 무료공영주차장','제주도 제주시 노형동 2517-1','0','00:00~23:59','왕복','1',NULL,'1','33.482491','126.472000','한라대학 입구 노형 지구대 → 바다 방향으로 25m 이동 → 오른쪽길로 87m 이동 → 왼쪽길로 113m 이동 → 노형동 정존마을회관 앞 무료공영주차장 도착','http://dmaps.kr/hg9m','http://blog.socar.kr/6951','',''),(7,'138','낙원상가','','낙원상가 공영주차장(쏘카지정구역)','서울시 종로구 낙원동 254-4','0','00:00~23:59','왕복','1',NULL,'1','37.572979','126.987991','종로3가역 5번출구로 나와 전방의 횡단보도이용 후 우측의 낙원악기상가 방면으로 50m 이동→낙원상가를 앞에 두고 우측 전방의 골목으로 진입 후 90m 이동→좌측 은성약국\r\n 앞 <strong><u>낙원상가 공영주차장(쏘카지정구역)</strong></u> 내 쏘카존\r\n\r\n<br><font color=#ff0000><strong> ※ 서울시나눔카 주차면 외 주차불가한 곳으로 타구역 주차 시 주차비가 청구